script: |
  super -f text -I q12526.spq | sort > q12526.out

inputs:
  - name: q12526.spq
    data: |
      SELECT DISTINCT - + 68 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( + col1 BETWEEN + ( col1 ) + - + col1 / + - col2 + - - col0 + + + 32 + + col2 AND NULL );
  - name: tab0

outputs:
  - name: q12526.out
    data: |
      -68
